import React, {Component} from 'react';
import './Birds.css'


class Birds extends Component {


    clickResult(item) {

    }

    render() {
        const {data, clazzAns} = this.props;
        let clazz = '' ;
        if (clazzAns){
            clazz = clazz + 'success'
        }else{
            clazz = clazz + 'error'
        }
            return (
                <ul className="item-list list-group">
                    {data.map((item) => (
                        <li className={`list-group-item ${clazz}`} key={item.id} onClick={() => this.clickResult(item)}>
                      <span className={'li-btn'}>
                      </span>
                            {item.name}
                        </li>
                    ))}
                </ul>
            );
    }
}

export default Birds;
